var category_1={},category_2={},category_3={},category_4={},category_5={};category_1.question_1={text:'في العملات الكندية، كم دولارًا يساوي "اللوني"؟',answer1:"$10",answer2:"$1",answer3:"$5",answer4:"$2",correctAnswer:2,popup:[""]},category_1.question_2={text:'في العملات الكندية، كم دولارًا يساوي "التوني"؟',answer1:"$20",answer2:"$200",answer3:"$2",answer4:"$0.25",correctAnswer:3,popup:[""]},category_1.question_3={text:"ماذا أفعل بالمال الذي لدي من بلدي الأم؟",answer1:"لا يمكن استخدامه هنا، لذلك فقط ارميه.",answer2:"أرسله إلى عائلتك في بلدك.",answer3:"اذهب إلى أحد البنوك أو متاجر الصرافة واستبدله بالدولار الكندي.",answer4:"تبرع به لجمعية خيرية.",correctAnswer:3,popup:[""]},category_1.question_4={text:"لماذا تحتاج إلى حساب بنكي؟",answer1:"حتى تتمكن من إيداع الشيكات الخاصة بك وكذلك حماية وتتبع أموالك.",answer2:"ليس لديك، فقط احفظ أموالك في مكان آمن.",answer3:"لأن الأمر هكذا أسهل لإنفاق أموالك.",answer4:"ليس لديك، يمكنك استخدام الشيكات الخاصة بك في المتاجر لشراء أي شيء تحتاجه.",correctAnswer:1,popup:[""]},category_1.question_5={text:"ما هي بعض الطرق التي يمكنك من خلالها توفير المال لدفع رسوم الكلية أو الجامعة أو المدرسة المهنية؟",answer1:"المنح",answer2:"المعونة الطلابية لمانيتوبا.",answer3:"خطة الادخار التعليمية المسجلة (RESP).",answer4:"جميع ما سبق",correctAnswer:4,popup:["الكليات والجامعات مكلفة للغاية، ولكن توجد برامج لمساعدتك. تحدث إلى مستشار التوجيه الخاص بك في المدرسة إذا كنت بحاجة إلى المساعدة."]},category_1.question_6={text:"ما هو العمر المطلوب للعمل بشكل قانوني في مانيتوبا؟",answer1:"12",answer2:"13",answer3:"15",answer4:"18",correctAnswer:2,popup:[""]},category_1.question_7={text:"أين يمكنك الحصول على مساعدة في العثور على عمل؟",answer1:"معلمك أو مدير مدرستك.",answer2:"جمعية الشبان المسيحيين (YMCA) للإعلان عن الوظائف والتواصل مع فرص العمل.",answer3:"مستشار التوجيه الخاص بك.",answer4:"جميع ما سبق.",correctAnswer:4,popup:[""]},category_1.question_8={text:"صحيح أم خطأ: إذا لم تكن لديك خبرة وظيفية، يمكن اعتبار التطوع خبرة عمل.",answer1:"صحيح",answer2:"خطأ",answer3:"",answer4:"",correctAnswer:1,popup:["تحدث إلى مستشار التوجيه أو المعلم الخاص بك للحصول على مزيد من المعلومات حول فرص التطوع."]},category_1.question_9={text:"كيف يمكنك توفير المال أثناء التسوق؟",answer1:"مطابقة الأسعار - ستمنحك بعض المتاجر خصمًا إذا قامت متاجر أخرى مماثلة ببيع السلعة بسعر أقل.",answer2:"استخدام القسائم.",answer3:"المساومة مع موظفي المتجر.",answer4:"a & b",correctAnswer:4,popup:[""]},category_1.question_10={text:"ما هي بطاقة الخصم؟",answer1:"بطاقة تسجل ديونك.",answer2:"بطاقة تحضرها معك لفتح حساب بنكي.",answer3:"بطاقة يمكنك استخدامها للدفع مقابل الأشياء أو سحب النقود مباشرة من حسابك البنكي.",answer4:"بطاقة تعطيها لشخص مدين.",correctAnswer:3,popup:["عند فتح حساب بنكي، سيعطيك البنك بطاقة خصم. تتيح لك هذه البطاقة الوصول إلى الأموال الموجودة في حسابك البنك. سيكون لديك رقم PIN (رقم التعريف الشخصي) مع بطاقة الخصم الخاصة بك. لا تخبر أي شخص برقم التعريف الشخصي الخاص بك، حتى إذا كان شخصًا تثق به. يجب أن يبقى هذا الرقم خاصًا."]},category_2.question_1={text:"إذا كنت تشعر بالوحدة والعزلة، فأين يمكنك الذهاب للحصول على الدعم؟",answer1:"صديق",answer2:"معلم",answer3:"اذهب إلى أقرب مكتبة أو جمعية الشبان المسيحيين للتعرّف على برامج المجتمع",answer4:"جميع ما سبق",correctAnswer:4,popup:[""]},category_2.question_2={text:"صحيح أم خطأ: لا يجب أن تتحدث عن تجربتك باعتبارك قادم إلى كندا.",answer1:"صحيح",answer2:"خطأ",answer3:"",answer4:"",correctAnswer:2,popup:["مشاركة رحلتك مع الأشخاص الذين تثق بهم يمكن أن تجعل صداقتك أقرب وربما تشعر بأنك أقل وحدة."]},category_2.question_3={text:"ما الذي يمكن أن يساعدك عليه موظف الاستقرار؟",answer1:"التعرّف على برامج الوافدين الجدد في مدينتك.",answer2:"معلومات عن الإسكان والبنوك.",answer3:"التطوع وفرص العمل.",answer4:"جميع ما سبق.",correctAnswer:4,popup:[""]},category_2.question_4={text:"ما هي بعض الدلائل على أن شخص ما يعتبر صديق جيد؟",answer1:"عليك دائمًا أن تفعل ما يريدون القيام به.",answer2:"يطلبون منك المساعدة أحيانًا ولكنهم يساعدونك عندما تحتاج إليهم أيضًا.",answer3:"يتحدثون عنك مع أشخاص آخرين؛ ربما يقولون أشياء سيئة عنك للآخرين.",answer4:"a & c",correctAnswer:2,popup:[""]},category_2.question_5={text:"ما الذي يمكن أن يساعدك عليه معلمك؟",answer1:"فهم أمر ما.",answer2:"الحاجة الى مزيد من الوقت لعملك.",answer3:"لديك مشكلة مع زميل.",answer4:"جميع ما سبق.",correctAnswer:4,popup:[""]},category_2.question_6={text:"متى يجب أن ترسل الأموال إلى عائلتك في بلدك الأم؟",answer1:"في كل مرة يطلبون.",answer2:"كل شيكات الدفع - حتى لو لم يطلبوا.",answer3:"فقط عندما يتبقى معك القليل من المال بعد دفع فواتيرك.",answer4:"أبدًا، يجب عليهم كسب أموالهم الخاصة.",correctAnswer:3,popup:["قد يكون هناك الكثير من الضغط لإرسال الأموال إلى عائلتك في بلدك الأم. من الصعب إذا لم يكن لديك الكثير من المال. سيساعدك الاهتمام بنفسك واحتياجاتك على البقاء بصحة جيدة وقادرًا على دعم عائلتك على المدى الطويل."]},category_2.question_7={text:"لماذا تتحدث إلى مستشار التوجيه الخاص بك؟",answer1:"أنت تحتاج إلى المساعدة في اختيار دورات المدرسة.",answer2:"لديك أسئلة حول الكلية أو الجامعة أو التخرج أو الوظائف.",answer3:"أنت تحتاج إلى التحدث مع شخص ما عن الأمور التي تزعجك.",answer4:"جميع ما سبق.",correctAnswer:4,popup:[""]},category_2.question_8={text:"ماذا يمكنك أن تفعل عندما تواجه صعوبة في التكيف مع الحياة في كندا؟",answer1:"اجلسوا معًا كعائلة لمناقشة التحديات التي تواجهونها جميعًا.",answer2:"تواصل مع شخص تثق به وتعرّف على ما إذا كان يمكنه إيصالك بمستشار.",answer3:"تحدث إلى شباب آخرين جدد في كندا لدعم بعضكم البعض.",answer4:"جميع ما سبق.",correctAnswer:4,popup:[""]},category_2.question_9={text:"لماذا يجب أن تنضم إلى فريق أو نادي أو تطوع إذا كنت مشغولًا بالفعل بالمدرسة؟",answer1:"يساعدك ذلك على تعلم مهارات جديدة وبناء سيرتك الذاتية.",answer2:"سوف تلتقي بأشخاص جدد، مما قد يساعدك على الشعور بتحسن.",answer3:"من الصحي والمهم أن تأخذ استراحة من العمل المدرسي وأن يكون لديك هوايات.",answer4:"جميع ما سبق.",correctAnswer:4,popup:[""]},category_2.question_10={text:"ماذا يمكنك أن تفعل عندما يحتاج والداك إلى مساعدتك في المنزل ولكنك تشعر بالإرهاق؟",answer1:"تحدث إلى معلمك للحصول على نصائح حول كيفية إدارة وقتك بشكل أفضل.",answer2:"تحدّث إلى مستشار التوجيه الخاص بك. يمكنهم إخبارك بالخدمات المفيدة.",answer3:"a & b",answer4:"تجنب مسؤولياتك وشاهد التلفاز.",correctAnswer:3,popup:[""]},category_3.question_1={text:"صحيح أم خطأ: لعبة القتال أو المصارعة هي عادة كندية عادية.",answer1:"صحيح",answer2:"خطأ",answer3:"",answer4:"",correctAnswer:2,popup:["في كندا، قد يتصارع الأصدقاء والأشقاء من أجل المتعة. ولكن، يمكنك الوقوع في مشكلة بسبب القتال في الأماكن العامة."]},category_3.question_2={text:"ماذا يمكنك أن تفعل إذا كنت تعاني من العنصرية أو التمييز؟",answer1:"اذهب إلى مكان آخر وتجاهلهم.",answer2:"اطلب المساعدة من شخص ما حولك (على سبيل المثال، موظف أو معلم أو أحد المارة، وما إلى ذلك).",answer3:"إذا كنت تشعر بعدم الأمان، فاتصل برقم 911.",answer4:"جميع ما سبق.",correctAnswer:4,popup:[""]},category_3.question_3={text:"كيف يتم الاحتفال بعيد القديسين عادة في كندا؟",answer1:"تشاهد الألعاب النارية.",answer2:"تلبس الأزياء ويوزع الناس الحلوى.",answer3:"تنحت القرع وتروي قصصًا مخيفة.",answer4:"b & c",correctAnswer:4,popup:[""]},category_3.question_4={text:"ما هي الأعياد التي يتم الاحتفال بها خلال شهر ديسمبر في كندا؟",answer1:"الكريسماس",answer2:"هانوكا",answer3:"كوانزا",answer4:"جميع ما سبق (وأكثر من ذلك!)",correctAnswer:4,popup:["ربما سمعت الكثير عن الكريسماس، ولكن هناك العديد من الأعياد الدينية التي يتم الاحتفال بها في ديسمبر. لكل فرد في كندا الحرية في ممارسة دينه وثقافته. وهذا يشملك أيضًا!"]},category_3.question_5={text:"كيف يتم الاحتفال بعيد الشكر عادة هنا؟",answer1:"بتناول عشاء الديك الرومي مع عائلتك وقول ما أنت ممتن له.",answer2:"تقديم الهدايا والحصول عليها.",answer3:"نحت القرع.",answer4:"جميع ما سبق.",correctAnswer:1,popup:[""]},category_3.question_6={text:"هل مسموح لك اللعب ببنادق BB/ الكريات أو بنادق اللعب في كندا؟",answer1:"لا، لا يُسمح لك بالحصول على بنادق BB أو بنادق لعبة على الإطلاق.",answer2:"نعم، ولكن لا توجه بنادق BB الخاص بك إلى أي شخص أو تطلق على أي شخص.",answer3:"نعم، ولكن فقط إذا كان عمرك 16 عامًا أو أكبر.",answer4:"لا، فبنادق BB وبنادق اللعب غير قانونية ولا تُباع في المتاجر.",correctAnswer:2,popup:["يجب أن تكون حذرًا بشأن متى وأين وكيف تلعب ببنادق اللعب وبنادق الكريات. لا تحضرهم معك أبدًا إلى المدرسة أو إلى موعد مع طبيبك أو عامل الاستقرار أو أي شخص آخر. لا توجههم أبدًا إلى الغرباء - قد يظن الناس أن لديك بندقية حقيقية ويتصلون بالشرطة."]},category_3.question_7={text:"صحيح أم خطأ: الشرطة لديها السلطة لفعل أي شيء.",answer1:"صحيح",answer2:"خطأ",answer3:"",answer4:"",correctAnswer:2,popup:["لدى الشرطة مسؤوليات، تمامًا مثل المواطنين. لديك حقوق، تحدث إلى شخص تثق به للحصول على معلومات.  "]},category_3.question_8={text:"كيف يتم الاحتفال بيوم كندا عادة في وينيبيغ؟",answer1:"تلبس باللون الأحمر والأبيض وتذهب إلى The Forks.",answer2:"تشاهد الألعاب النارية.",answer3:"تحتفل بالملكة بشرب الشاي.",answer4:"a & b",correctAnswer:4,popup:[""]},category_3.question_9={text:"صحيح أم خطأ: عندما تنتقل إلى كندا، يجب عليك التخلي عن ثقافتك وتقاليدك لتناسبها.",answer1:"صحيح",answer2:"خطأ",answer3:"",answer4:"",correctAnswer:2,popup:["ثقافتك تمثل جزءًا كبيرًا من هويتك! قد يساعدك البقاء على اتصال بثقافتك عندما تشعر بالحنين إلى الوطن."]},category_3.question_10={text:"ما هو يوم الذكرى؟",answer1:"إنه يوم للاحتفال بتاريخ كندا.",answer2:"إنه يوم لرفع مستوى الوعي حول فقدان الذاكرة.",answer3:"إنه يوم لتكريم وتذكر الجنود الذين ماتوا في الحرب.",answer4:"لا شيء مما سبق.",correctAnswer:3,popup:["تقام الاحتفالات في جميع أنحاء البلاد في يوم الذكرى (11 نوفمبر) ويرتدي الناس الخشخاش (الزهور الحمراء) لإظهار أنهم ممتنون للتضحيات التي قدمها الجنود. من الشائع أن يتحدث الناس عن الحرب والمعارك والموت. إذا كان هذا مزعجًا ويجعلك تفكر في الأشياء التي حدثت في بلدك، فتحدث إلى أصدقائك أو عائلتك أو عامل لاستقرار للحصول على الدعم."]},category_4.question_1={text:'صحيح أم خطأ: الاستشارة مخصصة فقط للأشخاص "المجانين".',answer1:"صحيح",answer2:"خطأ",answer3:"",answer4:"",correctAnswer:2,popup:['المستشار هو شخص يستمع إليك ويساعدك؛ لست بحاجة إلى أن تكون "مجنونًا" لتزور واحدة.']},category_4.question_2={text:"صحيح أم خطأ: يجب عليك تجربة أشياء جديدة أو الانضمام إلى الأنشطة لأنها ستساعدك على الشعور براحة أكبر في مجتمعك الجديد.",answer1:"صحيح",answer2:"خطأ",answer3:"",answer4:"",correctAnswer:1,popup:[""]},category_4.question_3={text:"ماذا يمكنك أن تفعل عندما تشعر بالحزن؟",answer1:"استكشف مدينتك الجديدة. تحقق من المكتبة لمعرفة لأنشطة المجانية التي قد يقدمونها.",answer2:"تحدث إلى شخص بالغ موثوق به حول ما تشعر به؛ يمكن أن يكون هذا معلمًا، أو مستشارًا في المدرسة، أو عامل استقرار.",answer3:"صحيفة. قد يكون من المفيد كتابة أفكارك ومشاعرك.",answer4:"جميع ما سبق.",correctAnswer:4,popup:[""]},category_4.question_4={text:"ماذا يمكنك أن تفعل عندما تفتقد عائلتك في بلدك الأم؟",answer1:"اصنع وصفات تحبها عائلتك من المنزل.",answer2:"اتصل أو اكتب رسالة إلى أحبائك في الوطن.",answer3:"ابدأ في عمل صندوق تبرعات في مدرستك الجديدة وأرسل الأشياء إلى عائلتك وأصدقائك في بلدك الأم.",answer4:"جميع ما سبق.",correctAnswer:4,popup:["الشعور بالحنين إلى الوطن أمر طبيعي، خاصة بعد الانتقال إلى بلد جديد. إذا كنت تشعر بالوحدة أو الحزن، فتوجد موارد في المجتمع لمساعدتك."]},category_4.question_5={text:'صحيح أم خطأ: عندما تأتي إلى كندا، يجب أن تنسى تقاليد وطنك وتتصرف مثل "الكندي".',answer1:"صحيح",answer2:"خطأ",answer3:"",answer4:"",correctAnswer:2,popup:["من الصحي أن تبقى على اتصال بثقافتك. سيرغب الكثير من الناس في تعلّم ثقافتك والاحتفال بها!"]},category_4.question_6={text:"صحيح أم خطأ: توجد مشكلة لدي إذا لم أشعر بالارتباط بالتقاليد الكندية.",answer1:"صحيح",answer2:"خطأ",answer3:"",answer4:"",correctAnswer:2,popup:["من الطبيعي أن تشعر بالانفصال. قد يستغرق الأمر بضع سنوات قبل أن تشعر بالراحة في كندا."]},category_4.question_7={text:"ما الفرق بين المرور بوقت عصيب والمرض العقلي؟",answer1:"تحدث الأوقات العصيبة للجميع والمرض العقلي يحدث فقط لبعض الناس.",answer2:"أنت بحاجة إلى أنواع مختلفة من الدعم عندما تمر بوقت عصيب وعندما تعاني من مرض عقلي.",answer3:"يمكن علاج المرض العقلي ولا يمكن علاج الأوقات العصيبة.",answer4:"a &  b",correctAnswer:4,popup:["عندما تمر بوقت عصيب، قد تحتاج إلى دعم من عائلتك وأصدقائك ومعلميك. إذا كنت تعاني من مرض عقلي، فأنت بحاجة إلى دعم أحبائك، ولكن من المحتمل أيضًا أن تحتاج إلى دعم متخصص. لا تحتاج إلى الانتظار حتى تشعر بالإرهاق أو المرض الشديد - فكلما طلبت المساعدة مبكرًا، كانت الأمور أسهل. "]},category_4.question_8={text:"كيف يمكنني مساعدة صديقي إذا كنت قلقًا من أنه ليس بخير؟",answer1:"تحدث معه عن ذلك وأوصلهم بمعلم أو عامل استقرار.",answer2:"تحدث عنه مع أصدقائك الآخرين.",answer3:"أخبره أنه بحاجة إلى أن يكون أقوى وأن يتوقف عن الحزن.",answer4:"تجاهله يبدو أنه يريد أن يكون بمفرده.",correctAnswer:1,popup:[""]},category_4.question_9={text:"ما هو المرض العقلي؟",answer1:"عندما يكون دماغك مريضًا.",answer2:"نوع من الانفلونزا.",answer3:"مشكلة صحية تنطوي على تغييرات في العواطف والتفكير والسلوك تعوق طريق الحياة اليومية.",answer4:"لا شيء، ليس أمرًا حقيقيًا.",correctAnswer:3,popup:["المرض العقلي أكثر شيوعًا مما قد تدركه: يعاني حوالي 1 من كل 5 كنديين من مرض عقلي في حياتهم. القلق والاكتئاب هما من أكثر التشخيصات شيوعًا ويمكن مساعدة معظم الناس في العلاج والاستشارة والدعم."]},category_4.question_10={text:"ما الفرق بين الضغط والقلق؟",answer1:"لا شيء - إنهما متشابهان.",answer2:"الضغط هو قصير المدى وتشعر بتحسن بمجرد زواله.",answer3:"يبدو القلق مثل الضغط، لكنه لا يزول بمجرد زوال المشكلة.",answer4:"b & c",correctAnswer:4,popup:[""]},category_5.question_1={text:"ما هي الخيارات بعد التخرج من المدرسة الثانوية؟",answer1:"يمكنك الذهاب إلى الكلية أو الجامعة أو المدرسة المهنية.",answer2:"يمكنك الحصول على وظيفة.",answer3:"يمكنك التطوع و/ أو السفر.",answer4:"جميع ما سبق.",correctAnswer:4,popup:[""]},category_5.question_2={text:"صحيح أم خطأ: تحتاج إلى الذهاب إلى المدرسة ما بعد الثانوية مباشرة بعد التخرج من المدرسة الثانوية.",answer1:"صحيح",answer2:"خطأ",answer3:"",answer4:"",correctAnswer:2,popup:["ألست متأكدًا مما تريد دراسته؟ يمكن أن يساعدك التطوع في تحديد ما تريد القيام به."]},category_5.question_3={text:"من الذي يمكنك التحدث إليه إذا كنت لا تعرف ما تريد القيام به كمهنة؟",answer1:"مستشار التوجيه الخاص بك.",answer2:"معلمك.",answer3:"أصدقاءك أو والداك.",answer4:"جميع ما سبق.",correctAnswer:4,popup:[""]},category_5.question_4={text:"ما هي بعض الطرق لاختبار الوظائف المحتملة؟",answer1:"ابحث عن شخص يقوم بهذه المهمة وتحقق مما إذا كان بإمكانك زيارة مكان عمله.",answer2:"تطوع في شركة.",answer3:"تحقق مما إذا كان هناك فصل دراسي يمكنك الالتحاق به في المدرسة للمساعدة في إعدادك لمكان العمل.",answer4:"جميع ما سبق.",correctAnswer:4,popup:[""]},category_5.question_5={text:"في يوم من الأيام، قد ترغب في شراء منزل. ما هي بعض الأمور التي يمكنك القيام بها للاستعداد ماليًا الآن؟",answer1:"شراء الأثاث والديكور المنزلي.",answer2:"الإدخار، العمل، الإدخار.",answer3:"احصل على قرض من مكان قروض يوم الدفع.",answer4:"لا تفعل أي شيء، لأنك لن تكون قادرًا أبدًا على شراء منزل.",correctAnswer:2,popup:[""]},category_5.question_6={text:"ماذا تحتاج للتقدم للجامعة أو الكلية؟",answer1:"تحتاج إلى رقم التعليم والتدريب في مانيتوبا (MET).",answer2:"تحتاج إلى قائمة بدورات الصف 12، ودورة 40S للغة الإنجليزية ودرجاتك.",answer3:"تحتاج إلى دفع رسوم التقديم وإرسال بيان درجات المدرسة الثانوية إلى المدرسة التي تتقدم إليها.",answer4:"جميع ما سبق.",correctAnswer:4,popup:[""]},category_5.question_7={text:"كيف يمكنك التقدم للجامعة أو الكلية في مانيتوبا؟",answer1:"احضر صفًا دراسيًا وإذا حصلت على درجات جيدة، فأنت مقبول.",answer2:"اذهب إلى المكتب الرئيسي وادفع المال - ثم يتم قبولك.",answer3:"التقديم عبر الإنترنت من خلال موقع الجامعة أو الكلية.",answer4:"a & b",correctAnswer:3,popup:["قد يكون التقدم لكلية أو جامعة مربكًا. اطلب من معلمك أو مستشار التوجيه المساعدة إذا كنت بحاجة إليها."]},category_5.question_8={text:"ما هي ريادة الأعمال ولماذا يجب أن أضعها في اعتباري؟",answer1:"العمل في المتجر؛ العمل مع العملاء سيجعلك سعيدًا.",answer2:"بدء عملك الخاص؛ يمكنك متابعة شغفك الخاص وتكون رئيس نفسك.",answer3:"أن تكون طيارًا؛ أنت تجني الكثير من المال.",answer4:"لا شيء مما سبق.",correctAnswer:2,popup:["ريادة الأعمال تعني إدارة عملك الخاص. قد يبدو هذا مختلفًا اعتمادًا على مواهبك واهتماماتك. إذا كنت تفكر في بدء عملك الخاص، فهناك برامج يمكن أن تساعد في إعدادك لتكون رائد أعمال شابًا. اسأل مستشار التوجيه الخاص بك للحصول على مزيد من المعلومات. "]},category_5.question_9={text:"كيف تحصل على رخصة قيادة؟",answer1:"لست بحاجة إلى رخصة قيادة - طالما أنك جيد في القيادة، يُسمح لك بقيادة السيارة.",answer2:"تحتاج إلى الاشتراك في التأمين العام في مانيتوبا، واجتياز اختبار كتابي واختبار داخل السيارة.",answer3:"تحتاج أن يقوم شخص أكبر سنًا بإخبار الحكومة بأنك جيد في القيادة.",answer4:"يمنحك معلمك اختبارًا كتابيًا، وإذا نجحت، تحصل على رخصة.",correctAnswer:2,popup:[""]},category_5.question_10={text:"لماذا يهم إذا كنت سائقا آمنا؟",answer1:"ستكون بأمان وستنخفض مدفوعات تأمين سيارتك كل عام يمر بدون حوادث.",answer2:"ستحصل على جائزة من الحكومة إذا كان لديك سجل قيادة جيد.",answer3:"السائقون الآخرون سيعجبون بك.",answer4:"يمكنك الحصول على ترقية مجانية للسيارة.",correctAnswer:1,popup:[""]};